/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `GuardarPrecioUnitario` BEFORE INSERT ON `compra` FOR EACH ROW begin
 DECLARE precioUnitario float;
  DECLARE idAlimento integer;
select alimento.id as id_alimento INTO idAlimento from alimento,silo where silo.id_alimento=alimento.id and silo.id=NEW.id_silo;
set precioUnitario=NEW.precio_compra/NEW.cantidad_total;
 insert into preciounitarioalimento(precio,idAlimento) values (precioUnitario,idAlimento);
 
 end */;;
